create database Majesty;

use Majesty;

/******************************************/
/*   DatabaseName = maisi   */
/*   TableName = user   */
/******************************************/
CREATE TABLE `user`
(
    `id`                           int(11)      NOT NULL AUTO_INCREMENT,
    `uid`                          varchar(50)           DEFAULT NULL,
    `user_type`                    varchar(50)           DEFAULT NULL,
    `bu_id`                        int(11)               DEFAULT NULL,
    `team_id`                      int(11)               DEFAULT NULL,
    `team2_id`                     int(11)               DEFAULT NULL,
    `team3_id`                     int(11)               DEFAULT NULL,
    `email`                        varchar(50)  NOT NULL,
    `email_login_name`             varchar(50)           DEFAULT NULL,
    `emailpassword`                varchar(255)          DEFAULT NULL,
    `twostepenable`                tinyint(1)            DEFAULT NULL,
    `twostepsecretkey`             varchar(50)           DEFAULT NULL,
    `status`                       varchar(20)  NOT NULL,
    `englishName`                  varchar(255)          DEFAULT NULL,
    `chineseName`                  varchar(255)          DEFAULT NULL,
    `gender`                       tinyint(1)            DEFAULT NULL,
    `title_id`                     int(11)               DEFAULT NULL,
    `dateOfBirth`                  varchar(30)           DEFAULT NULL,
    `mobile`                       varchar(20)           DEFAULT NULL,
    `officeTel`                    varchar(20)           DEFAULT NULL,
    `fax`                          varchar(20)           DEFAULT NULL,
    `joinInDate`                   varchar(30)           DEFAULT NULL,
    `leaveDate`                    varchar(30)           DEFAULT NULL,
    `lang`                         varchar(20)           DEFAULT 'zh_CN',
    `isleader`                     tinyint(1)            DEFAULT NULL,
    `emailReplyWithSignature`      tinyint(1)            DEFAULT '0',
    `emailForwardWithSignature`    tinyint(1)            DEFAULT '0',
    `kpiReportView`                varchar(255)          DEFAULT NULL,
    `revenueReportView`            varchar(255)          DEFAULT NULL,
    `kpiHide`                      tinyint(1)            DEFAULT '0',
    `revenueHide`                  tinyint(1)            DEFAULT '0',
    `annualTarget`                 int(11)               DEFAULT NULL,
    `firstLogin`                   tinyint(1)            DEFAULT '1',
    `enablePop`                    tinyint(1)            DEFAULT '0',
    `email_error`                  tinyint(1)            DEFAULT '0',
    `public_key`                   varchar(255)          DEFAULT NULL,
    `listview`                     longtext,
    `datagroup_id`                 int(11)               DEFAULT NULL,
    `accessgroup_id`               int(11)               DEFAULT NULL,
    `token`                        varchar(255)          DEFAULT NULL,
    `lastNews_id`                  int(11)               DEFAULT NULL,
    `dataaccessgroup_id`           int(11)               DEFAULT NULL,
    `role`                         varchar(50)           DEFAULT NULL,
    `wechatcard_id`                int(11)               DEFAULT NULL,
    `baseuser_id`                  int(11)               DEFAULT NULL,
    `avatar`                       varchar(255)          DEFAULT NULL,
    `is_admin`                     tinyint(1)            DEFAULT NULL,
    `changePassword`               tinyint(1)            DEFAULT '0',
    `gllueextThisWeekCRVTarget`    int(11)               DEFAULT NULL,
    `gllueextWeekFirstRoundTarget` int(11)               DEFAULT NULL,
    `webemailaccount_id`           int(11)               DEFAULT NULL,
    `retainEmail`                  varchar(1024)         DEFAULT NULL,
    `annualTarget_month`           int(11)               DEFAULT NULL,
    `dateAdded`                    varchar(19)           DEFAULT NULL,
    `dateOfEdu`                    varchar(19)           DEFAULT NULL,
    `client_id`                    int(11)               DEFAULT NULL,
    `phone_status`                 tinyint(1)            DEFAULT '0' COMMENT '通话状态 0 未通话 1 通话中',
    `phone_time`                   datetime              DEFAULT NULL COMMENT '最近通话时间',
    `phone_end`                    datetime              DEFAULT NULL COMMENT '最近通话结束时间',
    `phone_total`                  int(11)               DEFAULT '0' COMMENT '通话时长（分钟）',
    `ownerAcc`                     varchar(20)           DEFAULT NULL COMMENT '慧拨账号',
    `positive_time`                char(11)              DEFAULT NULL COMMENT '转正日期',
    `is_deleted`                   tinyint(1)            DEFAULT '0',
    `tag_ids`                      varchar(255) NOT NULL DEFAULT '' COMMENT '用户标签id, 比如 ,12,3,5,',
    PRIMARY KEY (`id`) USING BTREE,
    UNIQUE KEY `user_email` (`email`) USING BTREE,
    UNIQUE KEY `user_wechatcard_id` (`wechatcard_id`) USING BTREE,
    UNIQUE KEY `user_baseuser_id` (`baseuser_id`) USING BTREE,
    KEY `user_title_id` (`title_id`) USING BTREE,
    KEY `user_team2_id` (`team2_id`) USING BTREE,
    KEY `user_team3_id` (`team3_id`) USING BTREE,
    KEY `user_accessgroup_id` (`accessgroup_id`) USING BTREE,
    KEY `user_bu_id` (`bu_id`) USING BTREE,
    KEY `user_team_id` (`team_id`) USING BTREE,
    KEY `user_dataaccessgroup_id` (`dataaccessgroup_id`) USING BTREE,
    KEY `user_webemailaccount_id` (`webemailaccount_id`) USING BTREE,
    KEY `user_id` (`id`) USING BTREE,
    KEY `user_englishname` (`englishName`) USING BTREE,
    KEY `user_id_user_status` (`id`, `status`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 0
  DEFAULT CHARSET = utf8
  ROW_FORMAT = DYNAMIC
;

