/******************************************/
/*   DatabaseName = maisi   */
/*   TableName = industry   */
/******************************************/
CREATE TABLE `industry`
(
    `id`        int(11)                         NOT NULL AUTO_INCREMENT,
    `name`      varchar(255) CHARACTER SET utf8 NOT NULL,
    `name_en`   varchar(255) CHARACTER SET utf8         DEFAULT NULL,
    `parent_id` int(11)                                 DEFAULT NULL,
    `order`     int(11)                                 DEFAULT NULL,
    `is_end`    tinyint(2)                              DEFAULT '0' COMMENT '是否已经到了末端',
    `number`    int(11)                                 DEFAULT NULL COMMENT '层数',
    `famous`    varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
    `is_other`  tinyint(2)                              DEFAULT '0',
    PRIMARY KEY (`id`) USING BTREE,
    KEY `name` (`name`) USING BTREE,
    KEY `id_parent_id` (`id`, `parent_id`) USING BTREE,
    KEY `is_other` (`is_other`) USING BTREE,
    KEY `order` (`order`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 0
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_unicode_ci
  ROW_FORMAT = DYNAMIC
;

/******************************************/
/*   DatabaseName = maisi   */
/*   TableName = joborder   */
/******************************************/
CREATE TABLE `joborder`
(
    `id`                           int(11)      NOT NULL AUTO_INCREMENT,
    `client_id`                    int(11)               DEFAULT NULL,
    `lineManager_id`               int(11)               DEFAULT NULL,
    `addedBy_id`                   int(11)               DEFAULT NULL,
    `jobgroup_id`                  int(11)               DEFAULT NULL,
    `city_id`                      int(11)               DEFAULT NULL,
    `city1_id`                     int(11)               DEFAULT NULL,
    `city2_id`                     int(11)               DEFAULT NULL,
    `function_id`                  int(11)               DEFAULT NULL,
    `bu_id`                        int(11)               DEFAULT NULL,
    `employmentType`               varchar(32)           DEFAULT NULL,
    `positionType`                 varchar(32)           DEFAULT NULL,
    `positionLevel`                varchar(32)           DEFAULT NULL,
    `priority`                     varchar(20)           DEFAULT NULL,
    `jobStatus`                    varchar(20)  NOT NULL,
    `totalCount`                   int(11)               DEFAULT NULL,
    `annualSalary`                 int(11)               DEFAULT NULL,
    `jobTitle`                     varchar(255) NOT NULL,
    `openDate`                     date                  DEFAULT NULL,
    `closeDate`                    date                  DEFAULT NULL,
    `source`                       varchar(255)          DEFAULT NULL,
    `dateAdded`                    datetime              DEFAULT NULL,
    `lastUpdateDate`               datetime              DEFAULT NULL,
    `is_deleted`                   tinyint(1)            DEFAULT '0',
    `description`                  longtext,
    `percentage`                   decimal(10, 4)        DEFAULT NULL,
    `salary_type`                  varchar(32)           DEFAULT NULL,
    `monthSalary`                  decimal(10, 2)        DEFAULT NULL,
    `month`                        int(11)               DEFAULT NULL,
    `estimatedOnboardDate`         datetime              DEFAULT NULL,
    `is_minimal_fee`               tinyint(1)            DEFAULT NULL,
    `revenue`                      decimal(10, 2)        DEFAULT NULL,
    `contract_id`                  int(11)               DEFAULT NULL,
    `ext1`                         longtext,
    `ext2`                         longtext,
    `ext3`                         longtext,
    `ext4`                         longtext,
    `ext5`                         longtext,
    `ext6`                         longtext,
    `ext7`                         longtext,
    `ext8`                         longtext,
    `ext9`                         longtext,
    `ext10`                        longtext,
    `ext11`                        longtext,
    `ext12`                        longtext,
    `ext13`                        longtext,
    `ext14`                        longtext,
    `ext15`                        longtext,
    `ext16`                        longtext,
    `ext17`                        longtext,
    `ext18`                        longtext,
    `ext19`                        longtext,
    `ext20`                        longtext,
    `workflow_spec_id`             int(11)      NOT NULL,
    `_approval_status`             varchar(255)          DEFAULT NULL,
    `workflow_id`                  int(11)               DEFAULT NULL,
    `gllueme_template`             longtext,
    `is_template`                  tinyint(1)   NOT NULL,
    `jobStatusUpdateDate`          datetime              DEFAULT NULL,
    `lastOperationFlowDateTime`    datetime              DEFAULT NULL,
    `maxStatus`                    varchar(255)          DEFAULT NULL,
    `lastUpdateBy_id`              int(11)               DEFAULT NULL,
    `is_private`                   tinyint(1)   NOT NULL DEFAULT '0',
    `_ext10`                       varchar(255)          DEFAULT NULL,
    `_ext2`                        longtext,
    `_ext1`                        longtext,
    `_ext14_id`                    int(11)               DEFAULT NULL COMMENT '行业id',
    `_ext13`                       varchar(255)          DEFAULT NULL,
    `_ext11`                       varchar(255)          DEFAULT NULL,
    `_ext12`                       varchar(255)          DEFAULT NULL,
    `lastContactBy_id`             int(11)               DEFAULT NULL,
    `lastContactDate`              varchar(255)          DEFAULT NULL,
    `livedays`                     int(11)               DEFAULT NULL,
    `gllueextVIPRcvTargetThisWeek` int(11)               DEFAULT NULL,
    `in_public`                    tinyint(1)            DEFAULT '0' COMMENT '0 未进入项目池 1进入项目池',
    `highlight`                    varchar(32)           DEFAULT NULL,
    `highlight1`                   varchar(32)           DEFAULT NULL,
    `highlight2`                   varchar(32)           DEFAULT NULL,
    `reason`                       varchar(255)          DEFAULT NULL,
    `demand`                       varchar(255)          DEFAULT NULL,
    `priority_condition`           varchar(255)          DEFAULT NULL,
    `work_place`                   varchar(255)          DEFAULT NULL,
    `key_problem`                  varchar(255)          DEFAULT NULL,
    `preference`                   varchar(255)          DEFAULT NULL,
    `joborder_level`               varchar(32)           DEFAULT NULL,
    `is_lm`                        tinyint(1)            DEFAULT '0' COMMENT '是否是 lm 1 是 0 否',
    PRIMARY KEY (`id`) USING BTREE,
    KEY `joborder_lineManager_id` (`lineManager_id`) USING BTREE,
    KEY `joborder_client_id` (`client_id`) USING BTREE,
    KEY `joborder_function_id` (`function_id`) USING BTREE,
    KEY `joborder_addedBy_id` (`addedBy_id`) USING BTREE,
    KEY `joborder_contract_id` (`contract_id`) USING BTREE,
    KEY `joborder_workflow_spec_id` (`workflow_spec_id`) USING BTREE,
    KEY `joborder_lastUpdateBy_id` (`lastUpdateBy_id`) USING BTREE,
    KEY `joborder_workflow_id` (`workflow_id`) USING BTREE,
    KEY `joborder_lastContactBy_id` (`lastContactBy_id`) USING BTREE,
    KEY `joborder_jobStatus` (`jobStatus`) USING BTREE,
    KEY `joborder_dateAdded` (`dateAdded`) USING BTREE,
    KEY `joborder_id` (`id`) USING BTREE,
    KEY `joborder_id_is_deleted` (`id`, `is_deleted`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 0
  DEFAULT CHARSET = utf8
  ROW_FORMAT = DYNAMIC
;

/******************************************/
