    KEY `jobsubmission_candidate_id` (`candidate_id`) USING BTREE,
    KEY `jobsubmission_joborder_id` (`joborder_id`) USING BTREE,
    KEY `jobsubmission_user_id` (`user_id`) USING BTREE,
    KEY `jobsubmission_position_id` (`position_id`) USING BTREE,
    KEY `jobsubmission_siteresume_id` (`siteresume_id`) USING BTREE,
    KEY `jobsubmission_active` (`active`) USING BTREE,
    KEY `jobsubmission_dateAdded` (`dateAdded`) USING BTREE,
    KEY `jobsubmission_lastUpdateDate` (`lastUpdateDate`) USING BTREE,
    KEY `joborderchannels_channel_id` (`channel_id`) USING BTREE,
    KEY `jobsubmission_glluemeuser_id` (`glluemeuser_id`) USING BTREE,
    KEY `jobsubmission_portalapply_id` (`portalapply_id`) USING BTREE,
    KEY `jobsubmission_me_resume_id` (`me_resume_id`) USING BTREE,
    KEY `jobsubmission_hub_position_id` (`hub_position_id`) USING BTREE,
    KEY `jobsubmission_workflow_id` (`workflow_id`) USING BTREE,
    KEY `jobsubmission_hub_resume_id` (`hub_resume_id`) USING BTREE,
    KEY `jobsubmission_me_position_id` (`me_position_id`) USING BTREE,
    KEY `jobsubmission_position_id_siteresume_id` (`position_id`, `siteresume_id`) USING BTREE,
    KEY `jobsubmission_uid2` (`uid2`) USING BTREE,
    KEY `jobsubmission_jobordersyncmaimai_id` (`jobordersyncmaimai_id`) USING BTREE,
    KEY `jobsubmission_id` (`id`) USING BTREE,
    KEY `jobsubmission_id_active` (`id`, `active`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 0
  DEFAULT CHARSET = utf8
  ROW_FORMAT = DYNAMIC
;

