/******************************************/
/*   DatabaseName = maisi   */
/*   TableName = achievement   */
/******************************************/
CREATE TABLE `achievement`
(
    `id`               int(11) unsigned NOT NULL AUTO_INCREMENT,
    `joborder_id`      int(11) unsigned             DEFAULT NULL COMMENT 'joborder主键',
    `jobsubmission_id` int(11) unsigned             DEFAULT NULL COMMENT '关联jobsubmission主键',
    `candidate_id`     int(11) unsigned             DEFAULT NULL COMMENT '关联candidate表主键',
    `uid`              int(11) unsigned             DEFAULT NULL COMMENT '创建此记录的用户id',
    `last_update_uid`  int(11) unsigned             DEFAULT NULL COMMENT '最后更新用户id',
    `achievement`      text,
    `ctime`            char(19)                     DEFAULT NULL COMMENT '添加时间',
    `last_update_time` char(19)                     DEFAULT NULL COMMENT '最后更新时间',
    `state`            tinyint(1) unsigned zerofill DEFAULT '0' COMMENT '用户是否操作过手动更新 1 是 0 否',
    PRIMARY KEY (`id`) USING BTREE,
    UNIQUE KEY `jobsubmission_id` (`jobsubmission_id`) USING BTREE,
    KEY `state` (`state`) USING BTREE,
    KEY `candidate_id_joborder_id` (`joborder_id`, `candidate_id`) USING BTREE,
    KEY `last_update_time` (`last_update_time`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 0
  DEFAULT CHARSET = utf8
  ROW_FORMAT = DYNAMIC COMMENT ='业绩结算表'
;

