    `ctime`            char(19)         DEFAULT NULL,
    PRIMARY KEY (`id`) USING BTREE,
    KEY `achievement_id` (`achievement_id`) USING BTREE,
    KEY `achievement_id_ctime` (`achievement_id`, `ctime`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 0
  DEFAULT CHARSET = utf8
  ROW_FORMAT = DYNAMIC COMMENT ='业绩结算单访问日志表'
;

