/******************************************/
/*   DatabaseName = maisi   */
/*   TableName = callrecords   */
/******************************************/
CREATE TABLE `callrecords`
(
    `id`           int(11) unsigned NOT NULL AUTO_INCREMENT,
    `recordId`     varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '本系统code、或者为followid',
    `startTime`    datetime                                DEFAULT NULL COMMENT '通话开始时间',
    `endTime`      datetime                                DEFAULT NULL COMMENT '通话结束时间',
    `type`         tinyint(1)                              DEFAULT NULL COMMENT '1 拨打电话 2 接听电话 3 挂断电话',
    `user_id`      int(11)                                 DEFAULT NULL,
    `phone`        char(15) COLLATE utf8mb4_unicode_ci     DEFAULT NULL COMMENT '电话号码',
    `length`       int(11)                                 DEFAULT NULL COMMENT '电话时长',
    `is_call`      int(1)                                  DEFAULT '0' COMMENT '1 为拨打电话 0 为接听电话',
    `candidate_id` int(11)                                 DEFAULT NULL,
    `note_id`      int(11)                                 DEFAULT '0' COMMENT '0为未保存为备注',
    PRIMARY KEY (`id`) USING BTREE,
    KEY `recordId` (`recordId`(191)) USING BTREE,
    KEY `user_id` (`user_id`) USING BTREE,
    KEY `note_id` (`note_id`) USING BTREE,
    KEY `candidate_id` (`candidate_id`) USING BTREE,
    KEY `startTime_endTime` (`startTime`, `endTime`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 0
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_unicode_ci
  ROW_FORMAT = DYNAMIC
;

/******************************************/
/*   DatabaseName = maisi   */
/*   TableName = callrecordshistory   */
/******************************************/
CREATE TABLE `callrecordshistory`
(
    `id`              int(11) unsigned NOT NULL AUTO_INCREMENT,
    `followId`        varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '慧拨code',
    `startTime`       varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '电话开始时间',
    `endTime`         varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '电话结束时间',
    `timeLength`      int(11)                                 DEFAULT '0' COMMENT '电话通话时长',
    `callTyoe`        tinyint(1)                              DEFAULT '0' COMMENT '呼叫类型 1已接来电;2已拨电话;3未接来电4未接去电',
    `callerNum`       varchar(20) COLLATE utf8mb4_unicode_ci  DEFAULT NULL COMMENT '主叫号码',
    `calledNum`       varchar(20) COLLATE utf8mb4_unicode_ci  DEFAULT NULL COMMENT '被叫号码',
    `code`            varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '通话标识',
    `recordURL`       varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '录音地址',
    `communicationNO` varchar(20) COLLATE utf8mb4_unicode_ci  DEFAULT NULL COMMENT '通信号码',
    `ownerAcc`        varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '慧拨账号',
    `user_id`         int(11)                                 DEFAULT NULL,
    PRIMARY KEY (`id`) USING BTREE,
    KEY `ownerAcc_startTime_endTime` (`ownerAcc`, `startTime`(191), `endTime`(191)) USING BTREE,
    KEY `startTime_recordURL_callTyoe_user_id` (`startTime`(191), `callTyoe`, `recordURL`(191), `user_id`) USING BTREE,
    KEY `callrecordshistory_code` (`code`(191)) USING BTREE,
    KEY `followId` (`followId`(191)) USING BTREE,
    KEY `callrecordshistory_calledNum` (`calledNum`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 0
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_unicode_ci
  ROW_FORMAT = DYNAMIC COMMENT ='记录慧通http发送的记录'
;

/******************************************/
/*   DatabaseName = maisi   */
/*   TableName = cancelinvoice   */
/******************************************/
CREATE TABLE `cancelinvoice`
(
    `id`               int(11) unsigned NOT NULL AUTO_INCREMENT,
    `jobsubmission_id` int(11) unsigned    DEFAULT NULL COMMENT '项目人才关联id',
    `user_id`          varchar(255)        DEFAULT NULL COMMENT '被通知财务id',
    `send_to`          varchar(255)        DEFAULT NULL COMMENT '抄送人id',
    `reason_id`        int(11) unsigned    DEFAULT NULL COMMENT '作废申请原因',
    `type`             tinyint(1) unsigned DEFAULT NULL COMMENT '作废申请状态 1.作废申请通过 0.作废申请拒绝 2.作废暂无申请 3.作废申请待处理',
    `question`         text COMMENT '发票作废问题原因改进方法等',
    `turndown_way`     tinyint(1) unsigned DEFAULT NULL COMMENT '作废方式 1.全款退款 2.全款抵扣 3.部分退款 4.部分抵扣 5.其他',
    `invoice_id`       int(11) unsigned    DEFAULT NULL COMMENT '业绩分配表id',
    `c_time`           char(19)            DEFAULT NULL COMMENT '创建时间',
    `add_uid`          int(11) unsigned    DEFAULT NULL COMMENT '发起人',
    `reject_reason`    text COMMENT '拒绝原因',
    `check_uid`        int(11)             DEFAULT NULL COMMENT '审核人',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 0
  DEFAULT CHARSET = utf8
  ROW_FORMAT = DYNAMIC
;

