    KEY `candidate_mobile1` (`mobile1`) USING BTREE,
    KEY `candidate_mobile2` (`mobile2`) USING BTREE,
    KEY `candidate_linkedin` (`linkedin`) USING BTREE,
    KEY `candidate_dateAdded` (`dateAdded`) USING BTREE,
    KEY `candidate_glluemeuser_id` (`glluemeuser_id`) USING BTREE,
    KEY `candidate_lock_user_id` (`lock_user_id`) USING BTREE,
    KEY `candidate_lastContactBy_id` (`lastContactBy_id`) USING BTREE,
    KEY `candidate_lastContactDate` (`lastContactDate`) USING BTREE,
    KEY `candidate_englishName_is_deleted` (`englishName`, `is_deleted`) USING BTREE,
    KEY `candidate_chineseName_is_deleted` (`chineseName`, `is_deleted`) USING BTREE,
    KEY `candidate_last_status` (`last_status`) USING BTREE,
    KEY `candidate_last_status_date` (`last_status_date`) USING BTREE,
    KEY `candidate_type` (`type`) USING BTREE,
    KEY `candidate_email` (`email`) USING BTREE,
    KEY `candidate_email1` (`email1`) USING BTREE,
    KEY `candidate_email2` (`email2`) USING BTREE,
    KEY `candidate_lastUpdateDate` (`lastUpdateDate`) USING BTREE,
    KEY `candidate_work_years` (`total_work_years`) USING BTREE,
    KEY `candidate_company` (`company_id`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 0
  DEFAULT CHARSET = utf8
  ROW_FORMAT = DYNAMIC
;

