/*   TableName = candidateexperience   */
/******************************************/
CREATE TABLE `candidateexperience`
(
    `id`            int(11)    NOT NULL AUTO_INCREMENT,
    `lang`          varchar(10)         DEFAULT NULL,
    `start`         varchar(10)         DEFAULT NULL,
    `end`           varchar(10)         DEFAULT NULL,
    `candidate_id`  int(11)    NOT NULL,
    `client_id`     int(11)    NOT NULL,
    `title`         varchar(255)        DEFAULT NULL,
    `description`   longtext,
    `function_id`   int(11)             DEFAULT NULL,
    `function1_id`  int(11)             DEFAULT NULL,
    `function2_id`  int(11)             DEFAULT NULL,
    `is_current`    tinyint(1) NOT NULL,
    `ext1`          longtext,
    `ext2`          longtext,
    `ext3`          longtext,
    `ext4`          longtext,
    `ext5`          longtext,
    `ext6`          longtext,
    `ext7`          longtext,
    `ext8`          longtext,
    `ext9`          longtext,
    `ext10`         longtext,
    `department_id` int(11)             DEFAULT NULL,
    `is_recent`     tinyint(1) NOT NULL DEFAULT '0',
    `_ext10`        varchar(255)        DEFAULT NULL,
    `_ext1`         varchar(255)        DEFAULT NULL,
    `department`    varchar(255)        DEFAULT NULL,
    `oid`           int(11)             DEFAULT '0' COMMENT '部门id',
    `topic`         varchar(255)        DEFAULT NULL COMMENT '部门标题',
    `mapping_uid`   int(11)             DEFAULT NULL COMMENT 'mapping维护人',
    `addedBy_id`    int(11) unsigned    DEFAULT NULL COMMENT '添加人才id',
    PRIMARY KEY (`id`) USING BTREE,
    KEY `candidateexperience_function_id` (`function_id`) USING BTREE,
    KEY `candidateexperience_function1_id` (`function1_id`) USING BTREE,
    KEY `candidateexperience_function2_id` (`function2_id`) USING BTREE,
    KEY `candidateexperience_candidate_id` (`candidate_id`) USING BTREE,
    KEY `candidateexperience_client_id` (`client_id`) USING BTREE,
    KEY `candidateexperience_department_id` (`department_id`) USING BTREE,
    KEY `candidateexperience_is_recent` (`is_recent`) USING BTREE,
    KEY `candidateexperience_client_id_is_recent` (`client_id`, `is_recent`) USING BTREE,
    KEY `candidateexperience_title_is_recent` (`title`, `is_recent`) USING BTREE,
    KEY `candidateexperience_candidate_id_is_recent` (`candidate_id`, `is_recent`) USING BTREE,
    KEY `candidateexperience_lang_end_is_current` (`lang`, `end`, `is_current`) USING BTREE,
    KEY `candidateexperience_oid_id` (`oid`) USING BTREE,
    KEY `candidateexperience_mapping_uid` (`mapping_uid`) USING BTREE,
    KEY `is_current` (`is_current`) USING BTREE,
    KEY `client_id_is_current_oid` (`client_id`, `is_current`, `oid`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 0
  DEFAULT CHARSET = utf8
  ROW_FORMAT = DYNAMIC
;

