(
    `id`               int(11) unsigned NOT NULL AUTO_INCREMENT,
    `addedBy_id`       int(11) unsigned DEFAULT NULL COMMENT '操作用户id',
    `jobsubmission_id` int(11) unsigned DEFAULT NULL COMMENT 'jobsubmission主键',
    `candidate_id`     int(11) unsigned DEFAULT NULL COMMENT '人才表主键',
