    PRIMARY KEY (`id`) USING BTREE,
    UNIQUE KEY `jobsubmission_id` (`jobsubmission_id`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 0
  DEFAULT CHARSET = utf8
  ROW_FORMAT = DYNAMIC COMMENT ='过保确认表'
;

