    `c_user_id`             int(11) unsigned NOT NULL COMMENT '添加用户',
    `u_user_id`             int(11) unsigned NOT NULL COMMENT '更新用户',
    `d_user_id`             int(11) unsigned          DEFAULT NULL COMMENT '删除用户',
    `is_del`                tinyint(1)                DEFAULT NULL COMMENT '1删除，NULL未删除',
    `dtime`                 char(19)                  DEFAULT NULL COMMENT '删除时间',
    `ctime`                 char(19)         NOT NULL COMMENT '创建时间',
    `utime`                 char(19)         NOT NULL COMMENT '更新时间',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 0
  DEFAULT CHARSET = utf8
  ROW_FORMAT = DYNAMIC COMMENT ='调整申请表'
;

