    `reason`           tinyint(1) unsigned DEFAULT NULL COMMENT 'turndown原因 1.候选人留任现公司 2.候选人接受其他Offer 3.客户解除Offer  4.客户主动解除劳务合同 5.候选人主动提出离职',
