    `add_by_id`        int(11)             DEFAULT NULL COMMENT 'turndown的添加人',
    `ctime`            datetime            DEFAULT NULL COMMENT '创建时间',
    `jobsubmission_id` int(11)             DEFAULT NULL COMMENT '人才项目流程关联id',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB
  AUTO_INCREMENT = 0
  DEFAULT CHARSET = utf8
  ROW_FORMAT = DYNAMIC
;

